from datetime import datetimefrom sqlalchemy import (    Column,    Integer,    PrimaryKeyConstraint,    String,    DateTime,)from models.BaseModel import EntityMetaclass Myskinsolution(EntityMeta):    __tablename__ = "tb_C_MySkinSolution"  #    idx =  Column(Integer)      # idx    surveyNo =  Column(Integer)      # surveyNo    userKey =  Column(Integer)      # userKey    surveyDate =  Column(String(10))      # surveyDate    name =  Column(String(1000))      # name    specialtip_memo =  Column(String(4000))      # specialtip_memo    specialtip_memo3 =  Column(String(4000))      # specialtip_memo3    specialtip_memo2 =  Column(String(4000))      # specialtip_memo2    manager_value =  Column(String(50))      # manager_value    create_dt = Column(DateTime, default=datetime.now())  # 등록일    update_dt = Column(DateTime, default=datetime.now(), onupdate=datetime.now())  # 수정일    PrimaryKeyConstraint(idx)